While developing an RCP application, the customer requested several significant changes to the way TitleArea looked and behaved. 

Although most of these were changes that would be rather simple to implement or override, the way title area is implemented currently caused me to rewrite most of the dialog from scratch (copying original implementation and making changes where necessary).

A many of the other useful dialog classes descend from the TitleAreaDialog, I had to re implement those as well, to get the title area working uniformly across the entire application.

That is much more code that I should need to write to implement/modify customized TitleArea...

I suggest refactoring TitleArea implementation from the TitleAreaDialog into a separate class, add a method for providing default implementation of TitleArea to all TitleAreaDialog subtypes (much like Window class provides default exception handler)

Current methods setMessage, setErrorMessage and such would delegate to this TitleArea component that handles the representation of the dialog title area.

Poposed API could look something like this:

==<TitleAreaDialog.java>==
public class TitleAreaDialog extends Dialog {
  ...
  private static titleAreaFactory = new DefaultTitleAreaFactory();

  public static setTitleAreaFactory(ITitleAreaFactory factory) {
    if (titleAreaFactory instanceof DefaultTitleAreaFactory) {
      titleAreaFactory = factory;
    }
  }
  public TitleAreaDialog(Shell parentShell) {
    super(parentShell);
    titleArea = createTitleAreaImpl();
  }
  ...
  private TitleArea titleArea;
  public TitleArea createTitleAreaImpl() {
    return titleAreaFactory.createTitleArea();
  }
  ...
  private Control createTitleArea(Composite parent) {
    return titleArea.createContents(parent);
  }
  ...
}

==<TitleArea.java>==
public abstract class TitleArea implements IMessagePovider {
  public abstract Control createContents(Composite parent);
  public String getTitle() {
    return title;
  }
  public void setTitle(String title) {
    this.title = title;
    updateTitle();
  }
  protected abstract void updateTitle();

  public String getMessage() {[...]
  public void setMessage(String message) {[...]
  protected abstract void updateMessage();

  ... etc.
}

