There seems to be an error with Eclipse generating the equals method. For example if we have a Simple class with the equals generated by Eclipse we get:
public class SimpleClass
{
   int i;
   public boolean equals(Object obj)
   {
      if (this == obj)
         return true;
      if (obj == null)
         return false;
      if (getClass() != obj.getClass())
         return false;
      final SimpleClass other = (SimpleClass) obj;
      if (i != other.i)
         return false;
      return true;
   }  }
Which is correct, but if we use Eclipse to re-generate the equals method, we get:
public class SimpleClass
{
   int i;
     public boolean equals(Object obj)
   {
      if (this == obj)
         return true;
      if (!super.equals(obj))
         return false;
      if (getClass() != obj.getClass())
         return false;
      final SimpleClass other = (SimpleClass) obj;
      if (i != other.i)
         return false;
      return true;
   }
}
Note the lines "  if (!super.equals(obj))
         return false;" which is incorrect!

It turned out to be caused by a plug-in that installs a KeyListener on the top-level composite. To reproduce, use the snippet below. When form.addKeyListener(..) is called, then Tab does not give the focus to the button any more. When the KeyListener is not added, Tab works as expected.

I would not expect that adding a listener changes the world so fundamentally.


public class Bug157797 {

public static void main(String[] args) {
	Display display = new Display();
	Shell shell = new Shell(display);
	shell.setLayout (new FillLayout());

	Composite form= new Composite(shell, SWT.NONE);
	form.setLayout(new GridLayout());

	Label label1= new Label(form, SWT.NONE);
	label1.setText("Label1");
	Button button= new Button(form, SWT.PUSH);
	button.setText("Button");
	StyledText text= new StyledText(form, SWT.WRAP | SWT.READ_ONLY);
	text.setText("This is a StyleText with\nlinebreaks\nand everything.");

	form.addKeyListener(new KeyAdapter() {
		public void keyPressed(KeyEvent e) {
			System.out.println("I like keydowns: " + e);
		}
	});

	form.setFocus();
	shell.setSize(400, 300);
	shell.open();

	while (!shell.isDisposed ()) {
		if (!display.readAndDispatch ()) display.sleep ();
	}
	display.dispose ();
}
}

(In reply to comment #2)
> I would not expect that adding a listener changes the world so fundamentally.

Actually, sometimes the behaviour of an SWT control /does/ depend on whether
certain types of listeners are installed. There are two points here:

- Adding a key listener makes the composite itself a focusable control
  so pressing Tab from within the StyledText will transfer the focus
  to the composite itself, not the button.
- Once a composite listens to key events, it is responsible for actively
  allowing traverse events arising from those key events to be processed
  if that is desired. In the example snippet, this would mean adding code
  along the lines of the following:

    form.addTraverseListener(new TraverseListener() {
      public void keyTraversed(TraverseEvent e) {
        e.doit = true;
      }
    });

Note that there may be some subtle differences in this area between Composite
and its subclass Canvas, but that's the gist of it.
